import React, { Component } from 'react'

class ListItems extends Component{
    render(){

        this.props.itemContent.map((item, index)=>{
            return <li>item[index]</li>;
        })
        return (
           <div> 
                {
                    this.props.itemContent[0]
                }
            </div>
        )
    }
}

export default ListItems
